import React from 'react'
import ToDo from './ToDo'

const ToDoList = (toDoes) => {


    const listTodoes = toDoes.map((todo) => {
        <li>{todo}</li>
    })

  return (
    <ul>
        {listTodoes}
    </ul>
  )
}

export default ToDoList
